import React, {Component} from "react";

export default class InputPanelWithConfirmation extends Component {


    
    render() {

        return(
            <tr>
                <td>
                    <label htmlFor={this.props.confirmationInput}>{this.props.label}</label>
                </td>

                <td>
                    <div id="confirmationError">{this.props.error}</div>

                    <input id={this.props.confirmationInput} 
                           ref={this.props.confirmationInput}
                           type="text"
                           name={this.props.confirmationInput}
                           onChange={this.props.onChange} 
                    />

                    <div id="confirmationValue">{this.props.generatedValue}</div>
                </td>
            </tr>
        )
    }
}
